import React, { Component } from 'react';
import Todos from './components/Todos'

class App extends Component  {

  state = {
     todos : [
       {
         id: 1,
         title: 'Learn react',
         completed: false
       }, 
       {
        id: 2,
        title: 'Learn spring',
        completed: false
      }, 
      {
        id: 3,
        title: 'Learn docker',
        completed: false
      }
     ]
  }

  render () {
    console.log(this.state.todos)
    return (
      <div>
      <Todos todos= { this.state.todos }/>
      </div>
    )

  };
}

export default App;
